(15826, 'etc_soul_stone_i00.png', 'Red Soul Crystal - Stage 18', NULL, 'Red crystal containing the light of absorbed souls. stage 18. Special abilities can be applied to the weapon when absorbing certain amount of souls. MP 26 is consumed each time of use. A crystal of this level is said to absorb crystals on its own, so it doesn\'t seem like you need to use it directly on the monsters.', 'Красный Кристалл Души - Уровень 18', NULL, 'Красный кристалл, поглощающий души. Уровень 18. Наполнившись, Придает особые свойства оружию. Тратит 26 MP при каждом использовании.', 1, 1, 1, 'none', 'consume_type_normal'),
(15827, 'etc_soul_stone_i01.png', 'Blue Soul Crystal - Stage 18', NULL, 'Blue crystal containing the light of absorbed souls. stage 18. Special abilities can be applied to the weapon when absorbing certain amount of souls. MP 26 is consumed each time of use. A crystal of this level is said to absorb crystals on its own, so it doesn\'t seem like you need to use it directly on the monsters.', 'Синий Кристалл Души - Уровень 18', NULL, 'Синий кристалл, поглощающий души. Уровень 18. Наполнившись, Придает особые свойства оружию. Тратит 26 MP при каждом использовании.', 1, 1, 1, 'none', 'consume_type_normal'),
(15828, 'etc_soul_stone_i02.png', 'Green Soul Crystal - Stage 18', NULL, 'Green crystal containing the light of absorbed souls. stage 18. Special abilities can be applied to the weapon when absorbing certain amount of souls. MP 26 is consumed each time of use. A crystal of this level is said to absorb crystals on its own, so it doesn\'t seem like you need to use it directly on the monsters.', 'Зеленый Кристалл Души - Уровень 18', NULL, 'Зеленый кристалл, поглощающий души. Уровень 18. Наполнившись, Придает особые свойства оружию. Тратит 26 MP при каждом использовании.', 1, 1, 1, 'none', 'consume_type_normal'),
